import styles from './index.module.css';
import {connect} from 'react-redux'
import ActivitiesElem from '../ActivitiesElem/ActivitiesElem'
import {fetchMAXIMIZING} from '../../../actions/activities/activitiesList'
import React from 'react';

function ActivitiesList(props) {
    const {list} = props
    const expand = (id) => (id)
    return (
        <div>
            {list.map(elem =>
                 <ActivitiesElem key = {elem.id} props={elem} expand={expand}>
                 </ActivitiesElem>)}
        </div>
    )
}

const mapStateToProps = function(state) {
    return {list: state}
}

export default connect(mapStateToProps)(ActivitiesList);
